import React from 'react';
import { connect } from 'react-redux';
import config from '../../config';

class ContainmentPage extends React.Component {

  componentDidMount() {
    this.props.dispatch({
      type: config.UPDATE,
      update: {
        pageTitle: "Containment",
        activePage: "Containment"
      }
    })
  }

  render() {
    return  <div className="bx--grid bx--grid--full-width">
              <div className="bx--row">
              </div>
              <div className="bx--row">
                <Graph type="Containment" /> 
              </div>
              <div className="bx--row" style={{ marginTop: "16px" }}>
                <h1 className="improve-assistant-heading">Improve containment</h1>
                <p className="improve-assistant-desc">As you look to find ways to improve the performance of your assistant, use the<br></br> suggestions below to start your analysis by filtering conversations</p>
              </div>
              <div className="bx--row" style={{ marginLeft: "16px", marginBottom: "512px"}}>
                <OverviewTable type="frequentlyEscalated"></OverviewTable>
              </div>
          </div>;
  }

}

const mapStateToProps = (state) => {
  return { }
}

export default connect(mapStateToProps)(ContainmentPage);
